from functools import lru_cache

for _ in range(int(input())):
	s = input()
	v = ['aa','aaa','bb','bbb']
	@lru_cache(None)
	def dp(i):
		if i == len(s):
			return True
		ans = False
		for t in v:
			l = len(t)
			if len(t) <= len(s)-i:
				if t == s[i:i+l]:
					ans = ans or dp(i+l)
		return ans
	if dp(0):
		print("YES")
	else:
		print("NO")

